  return (
    <div className="App">
      <Header/>
      <h1>Hola mundo</h1>
      <h2>Este es mi primer componente React</h2>
      <div className='Parrafo'>
        <p>Bienvenido a mi aplicacion, esto fue creado con JS en React</p>
        <MiLista titulo="Personas" nombre1="Juan" nombre2="Pedro" nombre3="Adri" nombre4="Sergio"/>
        <MiLista titulo="Personas 2" nombre1="Juan" nombre2="Pedro" nombre3="Adri" nombre4="Sergio"/> 
        <MiLista titulo="Personas 3" nombre1="Juan" nombre2="Pedro" nombre3="Adri" nombre4="Sergio"/> 
      </div>
      <Footer/>
    </div>
  );
}

export default App;
